function click() { 
    $('#designer-toolbar-item-help').tooltip('hide');

    switch (this.require('designer').context()) {
      case 'system':
        this.require('designer').open('https://system-designer.readme.io/docs/create-a-system', '_blank', true); 
        break;
      case 'schemas':
        this.require('designer').open('https://system-designer.readme.io/docs/create-a-schema', '_blank', true); 
        break;
      case 'models':
        this.require('designer').open('https://system-designer.readme.io/docs/edit-a-model', '_blank', true); 
        break;
      case 'types':
        this.require('designer').open('https://system-designer.readme.io/docs/create-a-type', '_blank', true); 
        break;
      case 'behaviors':
        this.require('designer').open('https://system-designer.readme.io/docs/create-a-behavior', '_blank', true); 
        break;
      case 'components':
        this.require('designer').open('https://system-designer.readme.io/docs/create-a-component', '_blank', true); 
        break;
      case 'logs':
        this.require('designer').open('https://system-designer.readme.io/docs/run-your-system', '_blank', true);
        break;
      default:
        this.require('designer').open('https://system-designer.readme.io/docs/quick-start', '_blank', true); 
        break;
    }
}
